create database demo;

CREATE TABLE `employee_tbl` (
  `employee_id` int(15) NOT NULL AUTO_INCREMENT,
  `full_name` varchar(100)  NULL,
  `birthday` date  NULL,
  `addr_mail` varchar(100) null,
`address` varchar(100)  NULL,
  `phone_number` varchar(100)  NULL,
  `gender` varchar(100) null,
  `deleted_flag` boolean default false,
  PRIMARY KEY (`employee_id`)
  );
  
  CREATE TABLE `company_tbl` (
  `company_id` int(15) NOT NULL AUTO_INCREMENT,
  `company_name` varchar(100)  NULL,
  `address` varchar(100)  NULL,
  `description` varchar(100)  NULL,
  `year_established` int null,
  `deleted_flag` boolean default false,
  PRIMARY KEY (`company_id`)
  );
  
  CREATE TABLE `emp_company_tbl` (
  `emp_company_id` int(15) NOT NULL AUTO_INCREMENT,
  `company_id` int(15) ,
  `employee_id` int(15) ,
  PRIMARY KEY (`emp_company_id`),
  FOREIGN KEY (employee_id) REFERENCES employee_tbl(employee_id),
  FOREIGN KEY (company_id) REFERENCES company_tbl(company_id)
  );

